import React, { useState, useEffect } from "react";
import Navbar from "./Navbar";
import { useNavigate, useParams } from "react-router-dom";

const Developers = () => {
  const [items, setItems] = useState([]);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("http://localhost:5000/developers/" + id, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
        });
        const data = await response.json();
        if (data.result.length === 0) {
          alert(data.message);
          navigate("/home");
        } else {
          setItems(data.result);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [id]);

  return (
    <div>
      <Navbar />
      <div className="container bg-dark-subtle mt-5 py-5 border border-warning">
        <div className="text-center ">
          <h1>Web Developers</h1>
        </div>
        <div className="p-5 row">
          {items.map((item) => (
            <div
              key={item._id}
              className="card border-warning mt-5 p-4 col-5 mx-auto"
            >
              <div className="card-body">
                <h5 className="card-title">{item.name}</h5>
                <p className="card-text">
                  Rating:{" "}
                  {[...Array(item.rating)].map((_, index) => (
                    <span key={index} className="text-warning">
                      â˜…
                    </span>
                  ))}
                </p>

                <p className="card-text">Username: {item.username}</p>
              </div>

              <img src={"./logo192.png"} alt="Profile" />
            </div>
          ))}
          
        </div>
      </div>
    </div>
  );
};

export default Developers;
